import React, { useState } from 'react';
import axios from 'axios';
import { Table, TableBody, TableCell, TableContainer, TableHead, TableRow, Paper, TextField, Button } from '@mui/material';

const TrackingStatus = () => {
  const initialOrder = {
    id: 1,
    Number: '',
    RecipientDateTime: '',
    Status: '',
    DocumentCost: '',
    PhoneRecipient: '',
    RecipientFullName: '',
    CostOfGoods: '',
  };

  const [orders, setOrders] = useState([initialOrder]);
  const [nextId, setNextId] = useState(2);
  const [errors, setErrors] = useState({});

  const fetchOrderDetails = async (id, trackingNumber) => {
    try {
      const response = await axios.post('https://api.novaposhta.ua/v2.0/json/', {
        apiKey: 'a3e0146033929135960600cd27f26325',
        modelName: 'TrackingDocument',
        calledMethod: 'getStatusDocuments',
        methodProperties: {
          Documents: [
            {
              DocumentNumber: trackingNumber,
              Phone: '',
            },
          ],
        },
      });

      if (response.data.data && response.data.data.length > 0) {
        const data = response.data.data[0];
        console.log('API Response Data:', data);

        const updatedOrders = orders.map((order) =>
          order.id === id
            ? {
                ...order,
                RecipientDateTime: data.RecipientDateTime,
                Status: data.Status,
                DocumentCost: data.DocumentCost,
                PhoneRecipient: data.PhoneRecipient,
                RecipientFullName: data.RecipientFullName,
              }
            : order
        );
        setOrders(updatedOrders);
      } else {
        console.error('No data found for the given tracking number');
      }
    } catch (error) {
      console.error('Error fetching order details:', error);
    }
  };

  const handleNumberChange = (id, value) => {
    const updatedOrders = orders.map((order) =>
      order.id === id ? { ...order, Number: value } : order
    );

    const error = value.length !== 14 && value.length > 0 ? 'Введите 14-значный номер' : '';

    setErrors({ ...errors, [id]: error });
    setOrders(updatedOrders);

    if (value.length === 14) {
      fetchOrderDetails(id, value);
    }
  };

  const addOrder = () => {
    setOrders([
      ...orders,
      { ...initialOrder, id: nextId },
    ]);
    setNextId(nextId + 1);
  };

  const removeOrder = (id) => {
    setOrders(orders.filter((order) => order.id !== id));
    setErrors(Object.fromEntries(Object.entries(errors).filter(([key]) => key !== String(id))));
  };

  return (
    <TableContainer component={Paper}>
      <Table>
        <TableHead>
          <TableRow>
            <TableCell>Номер ЕН</TableCell>
            <TableCell>Дата отправки</TableCell>
            <TableCell>Статус отправки</TableCell>
            <TableCell>Сумма</TableCell>
            <TableCell>Номер телефона</TableCell>
            <TableCell>Имя</TableCell>
            <TableCell>Себестоимость</TableCell>
            <TableCell>Действия</TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {orders.map((order) => (
            <TableRow key={order.id}>
              <TableCell>
                <TextField
                  value={order.Number}
                  onChange={(e) => handleNumberChange(order.id, e.target.value)}
                  placeholder="Введите номер"
                  error={!!errors[order.id]}
                  helperText={errors[order.id]}
                />
              </TableCell>
              <TableCell>{order.RecipientDateTime}</TableCell>
              <TableCell>{order.Status}</TableCell>
              <TableCell>{order.DocumentCost}</TableCell>
              <TableCell>{order.PhoneRecipient}</TableCell>
              <TableCell>{order.RecipientFullName}</TableCell>
              <TableCell>
                <TextField
                  value={order.CostOfGoods}
                  onChange={(e) => setOrders(orders.map(o => o.id === order.id ? { ...o, CostOfGoods: e.target.value } : o))}
                  placeholder="Введите себестоимость"
                />
              </TableCell>
              <TableCell>
                <Button onClick={addOrder} variant="contained" color="primary">
                  Добавить
                </Button>
                <Button onClick={() => removeOrder(order.id)} variant="contained" color="secondary">
                  Удалить
                </Button>
              </TableCell>
            </TableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer>
  );
};

export default TrackingStatus;
